import Layout from "./Layout"

export default () => {
    return (
        <Layout>
            <div className='container'>
                <h1>My react app with next js</h1>
                <h5>Truong Duc Hoan</h5>
                <p>version: 1.0.0</p>
            </div>
        </Layout>
    )
}
